INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (190801, 1, "2030/01/01 14:59:59", "2025/01/31 12:00:00", "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", 0.0, 1000001, 1, -416.5, 3.414, 2, "カリン", 1, 62);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (190801, 1, "2030/01/01 14:59:59", "2025/01/31 12:00:00", "ミッションをクリアして、\n報酬をゲットしましょう！", 0.0, 1000002, 1, -416.5, 3.099, 2, "カリン", 2, 62);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (190801, 1, "2030/01/01 14:59:59", "2025/01/31 12:00:00", "受け取ることができる\n報酬があるようです\n確認してみてください", 0.0, 1000003, 1, -416.5, 2.801, 2, "カリン", 3, 63);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (190801, 2, "2030/01/01 14:59:59", "2025/01/31 12:00:00", "報酬がもらえますよ！\nチェックしてみてください", 0.0, 1000004, 1, -416.5, 0.0, 2, "カリン", 4, 63);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (190801, 2, "2030/01/01 14:59:59", "2025/01/31 12:00:00", "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 0.0, 1000005, 1, -363.0, 2.12, 1, "カリン", 5, 64);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (190801, 1, "2030/01/01 14:59:59", "2025/01/31 12:00:00", "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 0.0, 1000006, 1, -363.0, 1.68, 2, "カリン", 6, 64);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (190801, 2, "2030/01/01 14:59:59", "2025/01/31 12:00:00", "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 0.0, 1000007, 1, -363.0, 2.33, 1, "カリン", 7, 64);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (133701, 3, "2030/01/01 14:59:59", "2025/01/31 12:00:00", "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", -6.0, 1020101, 10201, -285.0, 5.18, 7, "ラビリスタ", 101, 61);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (133901, 1, "2030/01/01 14:59:59", "2025/01/31 12:00:00", "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", -2.0, 1020102, 10201, -285.0, 8.77, 2, "クリスティーナ", 201, 61);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (133801, 6, "2030/01/01 14:59:59", "2025/01/31 12:00:00", "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 0.0, 1020103, 10201, -285.0, 15.5, 1, "ネネカ", 301, 61);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (134301, 2, "2030/01/01 14:59:59", "2025/02/28 12:00:00", "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 0.0, 1020201, 10202, -285.0, 9.061, 5, "ランファ", 101, 61);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (134401, 1, "2030/01/01 14:59:59", "2025/02/28 12:00:00", "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 0.0, 1020202, 10202, -285.0, 7.699, 2, "チカ", 201, 61);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (134601, 1, "2030/01/01 14:59:59", "2025/03/31 12:00:00", "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 0.0, 1020301, 10203, -285.0, 8.595, 2, "アオイ", 101, 61);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (134501, 1, "2030/01/01 14:59:59", "2025/03/31 12:00:00", "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 0.0, 1020302, 10203, -285.0, 7.758, 2, "クローチェ", 201, 61);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (132302, 2, "2030/01/01 14:59:59", "2025/04/30 12:00:00", "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 0.0, 1020401, 10204, -285.0, 7.0, 6, "ルイズマリー", 101, 61);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (132402, 1, "2030/01/01 14:59:59", "2025/04/30 12:00:00", "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 0.0, 1020402, 10204, -285.0, 7.904, 2, "イロハ", 201, 61);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (132502, 4, "2030/01/01 14:59:59", "2025/04/30 12:00:00", "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 0.0, 1020403, 10204, -285.0, 8.487, 2, "ソノ", 301, 61);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (134901, 1, "2030/01/01 14:59:59", "2025/05/31 12:00:00", "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 0.0, 1020502, 10205, -285.0, 8.763, 2, "カノン", 101, 61);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (134801, 1, "2030/01/01 14:59:59", "2025/05/31 12:00:00", "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 0.0, 1020503, 10205, -285.0, 6.417, 3, "ツムギ", 201, 61);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (135001, 3, "2030/01/01 14:59:59", "2025/06/30 12:00:00", "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", 0.0, 1020601, 10206, -285.0, 10.335, 7, "エリス", 101, 61);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (135101, 2, "2030/01/01 14:59:59", "2025/06/30 12:00:00", "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", 0.0, 1020602, 10206, -285.0, 6.281, 4, "シェフィ", 201, 61);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (135201, 1, "2030/01/01 14:59:59", "2025/06/30 12:00:00", "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", 0.0, 1020603, 10206, -285.0, 12.244, 2, "プレシア", 301, 61);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (135301, 2, "2030/01/01 14:59:59", "2025/07/31 12:00:00", "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", 0.0, 1020701, 10207, -285.0, 6.339, 8, "クリア", 101, 61);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (135401, 7, "2030/01/01 14:59:59", "2025/07/31 12:00:00", "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", 0.0, 1020702, 10207, -285.0, 8.184, 9, "アネモネ", 201, 61);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (129101, 9, "2030/01/01 14:59:59", "2025/08/31 12:00:00", "あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！", 0.0, 1020801, 10208, -285.0, 3.906, 2, "アイラ", 101, 61);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (129201, 1, "2030/01/01 14:59:59", "2025/08/31 12:00:00", "繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？", 0.0, 1020802, 10208, -285.0, 14.465, 2, "シナツ", 201, 61);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (100101, 4, "2030/01/01 14:59:59", "2025/08/31 12:00:00", "アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！", 0.0, 1020803, 10208, -285.0, 8.662, 3, "ヒヨリ", 301, 61);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (100301, 1, "2030/01/01 14:59:59", "2025/08/31 12:00:00", "シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！", 0.0, 1020804, 10208, -285.0, 10.915, 3, "レイ", 401, 61);
